# -*- coding: utf-8 -*-# !/usr/bin/python# @Author: WX# @Create Time: 2020/4/21# @Software: PyCharmfrom google.protobuf import json_formatfrom pb_files.common_msg_def_pb2 import *from pb_files.quote_msg_def_pb2 import *from pb_files.quote_type_def_pb2 import *from test_config import *from websocket_py3.ws_base.ws_client import *from common.common_method import Commonfrom py_sqlite.market import MarketSqliteDBClientfrom common.test_log.ed_log import get_logimport jsonclass SubscribeApi(object):    def __init__(self, ws_url, new_loop, is_record=False, logger=None):        self.new_loop = new_loop        self.client = BaseWebSocketClient(url=ws_url, loop=self.new_loop)        self.common = Common()        self.sq = MarketSqliteDBClient(is_subscribe_record=is_record)        if logger:            self.logger = logger        else:            self.logger = get_log()    # 登录请求    async def LoginReq(self, token, start_time_stamp=None, frequence=None):        data_send = LoginReq(auto_token=token, start_time_stamp=start_time_stamp, frequence=frequence, user_name="onedi")        quote_msg = QuoteMsgCarrier(type=QuoteMsgType.LOGIN_REQ, data=data_send.SerializeToString())        quote_msg = quote_msg.SerializeToString()        all_req = await self.client.send_and_recv(quote_msg)        json_login_list = []        for req in all_req:            recv_data = QuoteMsgCarrier()            recv_data.ParseFromString(req)            if recv_data.type == QuoteMsgType.LOGIN_RSP:                login_data = LoginRsp()                login_data.ParseFromString(recv_data.data)                json_login_data = json_format.MessageToJson(login_data)                json_login_data = json.loads(json_login_data)                json_login_list.append(json_login_data)        self.logger.debug('LoginReq json_login_list:{}'.format(json_login_list))        return json_login_list    # 登出请求    async def LogoutReq(self, start_time_stamp=None, recv_num=1):        data_send = LogoutReq(start_time_stamp=start_time_stamp)        quote_msg = QuoteMsgCarrier(type=QuoteMsgType.LOGOUT_REQ, data=data_send.SerializeToString())        quote_msg = quote_msg.SerializeToString()        all_req = await self.client.send_and_recv(quote_msg, recv_num=recv_num)        json_logout_list = []        for req in all_req:            recv_data = QuoteMsgCarrier()            recv_data.ParseFromString(req)            if recv_data.type == QuoteMsgType.LOGOUT_RSP:                login_data = LogoutRsp()                login_data.ParseFromString(recv_data.data)                json_logout_data = json_format.MessageToJson(login_data)                json_logout_data = json.loads(json_logout_data)                json_logout_list.append(json_logout_data)        self.logger.debug('LogoutReq json_logout_list:{}'.format(json_logout_list))        return json_logout_list    # 心跳    async def HearbeatReqApi(self, connid, isKeep=False):        data_send = HeartReqMsg(conn_id=connid)        quote_msg = QuoteMsgCarrier(type=QuoteMsgType.HEARTBEAT_REQ, data=data_send.SerializeToString())        quote_msg = quote_msg.SerializeToString()        if isKeep == False:            all_req = await self.client.send_and_recv(quote_msg)            json_rsp_list = []            for base_req in all_req:                if base_req == None:                    continue                rev_data = QuoteMsgCarrier()                rev_data.ParseFromString(base_req)                if rev_data.type == QuoteMsgType.HEARTBEAT_RSP:                    single_data = HeartRspMsg()                    single_data.ParseFromString(rev_data.data)                    json_single_data = json_format.MessageToJson(single_data)                    json_single_data = json.loads(json_single_data)                    json_rsp_list.append(json_single_data)            self.logger.debug('HearbeatReqApi json_rsp_list:{}'.format(json_rsp_list))            return json_rsp_list        else:            await self.client.send(quote_msg)    # 保持心跳    async def hearbeat_job(self, gap_time=40):        i = 1        asyncio.set_event_loop(self.new_loop)        while True:            if self.client.is_disconnect():                break            await self.HearbeatReqApi(connid=i, isKeep=True)            self.logger.debug('The {} time to keep heartbeat! SendTimeStamp:{}'.format(i, str(time.time())))            await asyncio.sleep(gap_time)            i = i + 1    # 测速    async def VelocityReqApi(self, start_time=None):        data_send = VelocityReqMsg(start_time=start_time)        quote_msg = QuoteMsgCarrier(type=QuoteMsgType.VELOCITY_REQ, data=data_send.SerializeToString())        quote_msg = quote_msg.SerializeToString()        all_req = await self.client.send_and_recv(quote_msg)        json_rsp_list = []        for base_req in all_req:            rev_data = QuoteMsgCarrier()            rev_data.ParseFromString(base_req)            if rev_data.type == QuoteMsgType.VELOCITY_RSP:                single_data = VelocityRspMsg()                single_data.ParseFromString(rev_data.data)                json_single_data = json_format.MessageToJson(single_data)                json_single_data = json.loads(json_single_data)                json_rsp_list.append(json_single_data)        self.logger.debug('VelocityReqApi json_rsp_list:{}'.format(json_rsp_list))        return json_rsp_list    # 实时订阅    async def SubsQutoMsgReqApi(self, sub_type=None, child_type=None, base_info=None, recv_num=1, start_time_stamp=None,                                sub_quote_type=sub_quote_type, **kwargs):        '''        Return:        {            'first_rsp_list': [{}, {}, {}],  # 表示订阅应答响应 SUBSCRIBE_RSP            'snapshot_json_list': [{}, {}, {}, {}, {}],  # 表示返回的当前时间之前的合约快照数据            'basic_json_list': [{}, {}, {}, {}, {}]  # 表示返回的当前时间之前的合约静态数据            'orderbook_json_list': [{}, {}, {}, {}, {}]  # 表示返回的当前时间之前的合约盘口数据        }        '''        self.logger.debug('''sub_type: {}, child_type: {}, base_info: {}, sub_quote_type: {}'''.format(sub_type, child_type, base_info, sub_quote_type))        is_delay = False if sub_quote_type =="REAL_QUOTE_MSG" else True        send_data = SubscribeQuoteMsgReq(sub_type=sub_type, child_type=child_type, base_info=base_info, start_time_stamp=start_time_stamp, sub_quote_type=sub_quote_type)        quote_msg = QuoteMsgCarrier(type=QuoteMsgType.SUBSCRIBE_REQ, data=send_data.SerializeToString())        quote_msg = quote_msg.SerializeToString()        all_req = await self.client.send_and_recv(quote_msg, recv_num=recv_num)        first_rsp_list = []        for base_req in all_req:            rev_data = QuoteMsgCarrier()            rev_data.ParseFromString(base_req)            if rev_data.type == QuoteMsgType.SUBSCRIBE_RSP:                single_data = SubscribeQuoteMsgRsp()                single_data.ParseFromString(rev_data.data)                json_single_data = json_format.MessageToJson(single_data)                json_single_data = json.loads(json_single_data)                first_rsp_list.append(json_single_data)            elif rev_data.type == QuoteMsgType.HEARTBEAT_RSP:  # 如果接到心跳数据应忽略,继续接受一次                all_req = await self.client.recv(recv_num=1)                for base_req in all_req:                    rev_data = QuoteMsgCarrier()                    rev_data.ParseFromString(base_req)                    if rev_data.type == QuoteMsgType.SUBSCRIBE_RSP:                        single_data = SubscribeQuoteMsgRsp()                        single_data.ParseFromString(rev_data.data)                        json_single_data = json_format.MessageToJson(single_data)                        json_single_data = json.loads(json_single_data)                        first_rsp_list.append(json_single_data)        self.logger.debug('SubsQutoMsgReqApi first_rsp_list:{}'.format(first_rsp_list))        finally_rsp = {}        finally_rsp['first_rsp_list'] = first_rsp_list        before_snapshot_json_list = []        before_basic_json_list = []        before_orderbook_json_list = []        # 接收该合约前一刻的最新一笔静态、快照，直到更新时间超出请求时间则跳出        while True:            before_time_reqs = await self.client.recv(recv_num=1)            if before_time_reqs != []:                base_req = before_time_reqs[0]                rev_data = QuoteMsgCarrier()                rev_data.ParseFromString(base_req)                if (rev_data.type == QuoteMsgType.PUSH_SNAPSHOT):                    single_data = QuoteSnapshot()                    single_data.ParseFromString(rev_data.data)                    json_snapshot_data = json_format.MessageToJson(single_data)                    json_snapshot_data = json.loads(json_snapshot_data)                    req_source_time = self.common.searchDicKV(json_snapshot_data, 'sourceUpdateTime')                    instr_code = self.common.searchDicKV(json_snapshot_data, 'instrCode')                    exchange = self.common.searchDicKV(json_snapshot_data, 'exchange')                    if self.common.isDataBeforeSubscribe(exchange, is_delay, req_source_time, start_time_stamp,                                                         tolerance_time):                        # self.logger.debug('before_json_snapshot_data:{}'.format(json_snapshot_data))                        before_snapshot_json_list.append(json_snapshot_data)                        self.sq.subscribe_new_record(rev_data.type, instr_code, req_source_time, json_snapshot_data)                    else:                        break                elif rev_data.type == QuoteMsgType.PUSH_BASIC:                    single_data = QuoteBasicInfo()                    single_data.ParseFromString(rev_data.data)                    basic_single_data = json_format.MessageToJson(single_data)                    basic_single_data = json.loads(basic_single_data)                    req_source_time = self.common.searchDicKV(basic_single_data, 'updateTimestamp')                    instr_code = self.common.searchDicKV(basic_single_data, 'instrCode')                    exchange = self.common.searchDicKV(basic_single_data, 'exchange')                    # 毫秒级别对比                    if self.common.isDataBeforeSubscribe(exchange, is_delay, req_source_time, start_time_stamp,                                                         tolerance_time):                        # self.logger.debug('before_basic_single_data:{}'.format(basic_single_data))                        before_basic_json_list.append(basic_single_data)                        self.sq.subscribe_new_record(rev_data.type, instr_code, req_source_time, basic_single_data)                    else:                        break                elif rev_data.type == QuoteMsgType.PUSH_ORDER_BOOK:                    single_data = QuoteOrderBookData()                    single_data.ParseFromString(rev_data.data)                    basic_single_data = json_format.MessageToJson(single_data)                    basic_single_data = json.loads(basic_single_data)                    req_source_time = self.common.searchDicKV(basic_single_data, 'sourceUpdateTime')                    instr_code = self.common.searchDicKV(basic_single_data, 'instrCode')                    exchange = self.common.searchDicKV(basic_single_data, 'exchange')                    # 毫秒级别对比                    if self.common.isDataBeforeSubscribe(exchange, is_delay, req_source_time, start_time_stamp,                                                         tolerance_time):                        # self.logger.debug('before_basic_single_data:{}'.format(basic_single_data))                        before_orderbook_json_list.append(basic_single_data)                        self.sq.subscribe_new_record(rev_data.type, instr_code, req_source_time, basic_single_data)                    else:                        break                elif rev_data.type not in [QuoteMsgType.PUSH_SNAPSHOT, QuoteMsgType.PUSH_BASIC,                                           QuoteMsgType.PUSH_ORDER_BOOK, QuoteMsgType.HEARTBEAT_RSP,                                           QuoteMsgType.SUBSCRIBE_RSP]:                    break                else:                    pass            else:                break        finally_rsp['before_snapshot_json_list'] = before_snapshot_json_list        finally_rsp['before_basic_json_list'] = before_basic_json_list        finally_rsp['before_orderbook_json_list'] = before_orderbook_json_list        self.logger.debug('SubsQutoMsgReqApi finally_rsp:{}'.format(finally_rsp))        return finally_rsp    # 延时订阅    async def DelaySubsQutoMsgReqApi(self, sub_type=None, child_type=None, base_info=None, recv_num=1,                                start_time_stamp=None):        sub_quote_type = SubQuoteMsgType.DELAY_QUOTE_MSG        return await self.SubsQutoMsgReqApi(sub_type=sub_type, child_type=child_type, base_info=base_info, recv_num=recv_num,                                start_time_stamp=start_time_stamp, sub_quote_type=sub_quote_type)    # 取消行情订阅    async def UnSubsQutoMsgReqApi(self, unsub_type, unchild_type=None, unbase_info=None, recv_num=20, start_time_stamp=None, sub_quote_type=sub_quote_type):        self.logger.debug('''sub_type:{}, child_type:{}, base_info:{}, sub_quote_type:{}'''.format(unsub_type, unchild_type, unbase_info, sub_quote_type))        send_data = UnsubscribeQuoteMsgReq(sub_type=unsub_type, child_type=unchild_type, base_info=unbase_info,                                         start_time_stamp=start_time_stamp, sub_quote_type=sub_quote_type)        quote_msg = QuoteMsgCarrier(type=QuoteMsgType.UNSUBSCRIBE_REQ, data=send_data.SerializeToString())        quote_msg = quote_msg.SerializeToString()        all_req = await self.client.send_and_recv(quote_msg, recv_num=recv_num)        json_rsp_list = []        for base_req in all_req:            rev_data = QuoteMsgCarrier()            rev_data.ParseFromString(base_req)            if rev_data.type == QuoteMsgType.UNSUBSCRIBE_RSP:                single_data = UnsubscribeQuoteMsgRsp()                single_data.ParseFromString(rev_data.data)                json_single_data = json_format.MessageToJson(single_data)                json_single_data = json.loads(json_single_data)                json_rsp_list.append(json_single_data)        self.logger.debug('UnSubsQutoMsgReqApi json_rsp_list:{}'.format(json_rsp_list))        return json_rsp_list    # app订阅分时数据    async def SubscribeKlineMinReqApi(self, exchange, code, start_time_stamp, recv_num=5, sub_quote_type=sub_quote_type):        self.logger.debug('exchange:{}, code:{}, start_time_stamp:{}, sub_quote_type:{}'.format(exchange, code, start_time_stamp,sub_quote_type))        data_send = SubscribeKlineMinReq(exchange=exchange, code=code, start_time_stamp=start_time_stamp, sub_quote_type=sub_quote_type)        quote_msg = QuoteMsgCarrier(type=QuoteMsgType.SUBSCRIBE_KLINE_MIN_REQ, data=data_send.SerializeToString())        quote_msg = quote_msg.SerializeToString()        all_req = await self.client.send_and_recv(quote_msg, recv_num=recv_num)        rsp_list = []        for base_req in all_req:            rev_data = QuoteMsgCarrier()            rev_data.ParseFromString(base_req)            if rev_data.type == QuoteMsgType.SUBSCRIBE_KLINE_MIN_RSP:                single_data = SubscribeKlineMinRsp()                single_data.ParseFromString(rev_data.data)                json_single_data = json_format.MessageToJson(single_data)                json_single_data = json.loads(json_single_data)                rsp_list.append(json_single_data)            else:                if rev_data.type == QuoteMsgType.HEARTBEAT_RSP:                    continue                elif rev_data.type == QuoteMsgType.PUSH_KLINE_MIN:                    continue                self.logger.error("{} 消息未解析".format(rev_data.type))        self.logger.debug('SubscribeKlineMinReqApi rsp_list:{}'.format(rsp_list))        return rsp_list    # app取消订阅分时数据    async def UnsubscribeKlineMinReqApi(self, exchange, code, start_time_stamp, recv_num=5, sub_quote_type=sub_quote_type):        self.logger.debug('exchange:{}, code:{}, start_time_stamp:{}, sub_quote_type:{}'.format(exchange, code, start_time_stamp, sub_quote_type))        data_send = UnsubscribeKlineMinReq(exchange=exchange, code=code, start_time_stamp=start_time_stamp, sub_quote_type=sub_quote_type)        quote_msg = QuoteMsgCarrier(type=QuoteMsgType.UNSUBSCRIBE_KLINE_MIN_REQ, data=data_send.SerializeToString())        quote_msg = quote_msg.SerializeToString()        all_req = await self.client.send_and_recv(quote_msg, recv_num=recv_num)        rsp_list = []        for base_req in all_req:            rev_data = QuoteMsgCarrier()            rev_data.ParseFromString(base_req)            if rev_data.type == QuoteMsgType.UNSUBSCRIBE_KLINE_MIN_RSP:                single_data = UnsubscribeKlineMinRsp()                single_data.ParseFromString(rev_data.data)                json_single_data = json_format.MessageToJson(single_data)                json_single_data = json.loads(json_single_data)                rsp_list.append(json_single_data)            else:                if rev_data.type == QuoteMsgType.HEARTBEAT_RSP:                    continue                elif rev_data.type == QuoteMsgType.PUSH_KLINE_MIN:                    continue                self.logger.error("{} 消息未解析".format(rev_data.type))        self.logger.debug('UnsubscribeKlineMinReqApi rsp_list:{}'.format(rsp_list))        return rsp_list    # app订阅K线数据    async def SubscribeKLineMsgReqApi(self, peroid_type, base_info, start_time_stamp, recv_num=2, sub_quote_type=sub_quote_type):        '''        message SubscribeKLineMsgReq        {            KLinePeriodType                    peroid_type = 1;       // 频率            repeated SubscribeInstrBaseInfo    base_info  = 2;        // 合约信息            uint64                            start_time_stamp = 3;   // 发起请求的时间戳 UTC时间戳        }        message SubscribeInstrBaseInfo        {            common.ExchangeType exchange     = 1;           // 交易所            string              code         = 2;           // 合约代码            string              product_code = 3;           // 品种代码        }        '''        self.logger.debug('peroid_type: {},base_info: {},start_time_stamp: {}, sub_quote_type:{}'.format(peroid_type, base_info, start_time_stamp, sub_quote_type))        data_send = SubscribeKLineMsgReq(peroid_type=peroid_type, base_info=base_info, start_time_stamp=start_time_stamp, sub_quote_type=sub_quote_type)        quote_msg = QuoteMsgCarrier(type=QuoteMsgType.SUBSCRIBE_KLINE_REQ, data=data_send.SerializeToString())        quote_msg = quote_msg.SerializeToString()        all_req = await self.client.send_and_recv(quote_msg, recv_num=recv_num)        final_rsp = {}        sub_kline_rsp_list = []        for base_req in all_req:            rev_data = QuoteMsgCarrier()            rev_data.ParseFromString(base_req)            if rev_data.type == QuoteMsgType.SUBSCRIBE_KLINE_RSP:                single_data = SubscribeKLineMsgRsp()                single_data.ParseFromString(rev_data.data)                json_single_data = json_format.MessageToJson(single_data)                json_single_data = json.loads(json_single_data)                sub_kline_rsp_list.append(json_single_data)            else:                if rev_data.type == QuoteMsgType.HEARTBEAT_RSP:                    continue                elif rev_data.type == QuoteMsgType.PUSH_KLINE:                    continue                self.logger.error("{} 消息未解析".format(rev_data.type))        self.logger.debug('SubscribeKLineMsgReqApi sub_kline_rsp_list:{}'.format(sub_kline_rsp_list))        return sub_kline_rsp_list    # app取消订阅K线数据    async def UnsubscribeKLineMsgReqApi(self, peroid_type, base_info, start_time_stamp, recv_num=20, sub_quote_type=sub_quote_type):        # self.logger.debug(        #     'peroid_type: {},base_info: {},start_time_stamp: {}, sub_quote_type:{}'.format(peroid_type, base_info, start_time_stamp, sub_quote_type))        data_send = UnSubscribeKLineMsgReq(peroid_type=peroid_type, base_info=base_info,                                         start_time_stamp=start_time_stamp, sub_quote_type=sub_quote_type)        self.logger.debug("{} 接口的请求消息为 : \n{}".format(sys._getframe().f_code.co_name, data_send))        quote_msg = QuoteMsgCarrier(type=QuoteMsgType.UNSUBSCRIBE_KLINE_REQ, data=data_send.SerializeToString())        quote_msg = quote_msg.SerializeToString()        all_req = await self.client.send_and_recv(quote_msg, recv_num=recv_num)        final_rsp = {}        sub_kline_rsp_list = []        for base_req in all_req:            rev_data = QuoteMsgCarrier()            rev_data.ParseFromString(base_req)            if rev_data.type == QuoteMsgType.UNSUBSCRIBE_KLINE_RSP:                single_data = UnSubscribeKLineMsgRsp()                single_data.ParseFromString(rev_data.data)                json_single_data = json_format.MessageToJson(single_data)                json_single_data = json.loads(json_single_data)                sub_kline_rsp_list.append(json_single_data)            else:                if rev_data.type == QuoteMsgType.HEARTBEAT_RSP:                    continue                elif rev_data.type == QuoteMsgType.PUSH_KLINE:                    continue                self.logger.error("{} 消息未解析".format(rev_data.type))        self.logger.debug('UnsubscribeKLineMsgReqApi :{}'.format(sub_kline_rsp_list))        return sub_kline_rsp_list    # app订阅逐笔成交    async def SubscribeTradeTickReqApi(self, exchange, code, start_time_stamp, recv_num=20, sub_quote_type=sub_quote_type):        self.logger.debug('exchange:{}, code:{}, start_time_stamp:{}, sub_quote_type:{}'.format(exchange, code, start_time_stamp, sub_quote_type))        data_send = SubscribeTradeTickReq(exchange=exchange, code=code, start_time_stamp=start_time_stamp, sub_quote_type=sub_quote_type)        quote_msg = QuoteMsgCarrier(type=QuoteMsgType.SUBSCRIBE_TRADE_TICK_REQ, data=data_send.SerializeToString())        quote_msg = quote_msg.SerializeToString()        all_req = await self.client.send_and_recv(quote_msg, recv_num=recv_num)        rsp_list = []        for base_req in all_req:            rev_data = QuoteMsgCarrier()            rev_data.ParseFromString(base_req)            if rev_data.type == QuoteMsgType.SUBSCRIBE_TRADE_TICK_RSP:                single_data = SubscribeTradeTickRsp()                single_data.ParseFromString(rev_data.data)                json_single_data = json_format.MessageToJson(single_data)                json_single_data = json.loads(json_single_data)                rsp_list.append(json_single_data)            else:                if rev_data.type == QuoteMsgType.HEARTBEAT_RSP:                    continue                elif rev_data.type == QuoteMsgType.PUSH_TRADE_DATA:                    continue                self.logger.error("{} 消息未解析".format(rev_data.type))        self.logger.debug('SubscribeTradeTickReqApi rsp_list:{}'.format(rsp_list))        return rsp_list    # app取消订阅逐笔成交    async def UnsubscribeTradeTickReqApi(self, exchange, code, start_time_stamp, recv_num=50, sub_quote_type=sub_quote_type):        self.logger.debug('exchange:{}, code:{}, start_time_stamp:{}, sub_quote_type:{}'.format(exchange, code, start_time_stamp,sub_quote_type))        data_send = UnsubscribeTradeTickReq(exchange=exchange, code=code, start_time_stamp=start_time_stamp, sub_quote_type=sub_quote_type)        quote_msg = QuoteMsgCarrier(type=QuoteMsgType.UNSUBSCRIBE_TRADE_TICK_REQ, data=data_send.SerializeToString())        quote_msg = quote_msg.SerializeToString()        all_req = await self.client.send_and_recv(quote_msg, recv_num=recv_num)   